import Layout from '../components/Layout';
import Link from 'next/link';

const aboutLink = {
    textDecoration: 'none',
    color: 'rgb(212, 180, 34)',
    fontSize: '25px',
    fontVariantCaps: 'all-petite-caps'
}

const Home = () => (
    <Layout>
        <div id="bg">
            <img src="/image13.png" alt="homepage image" />
            <div id="home-text-box">
                <h1>Hi</h1><h2>, I am Melissa...</h2>
                <h3>A Full Stack Web Developer</h3>
                <Link href="/about">
                    <a style={aboutLink}>Let's get to know me >></a>
                </Link>
            </div> 
        </div>
        <button type="submit">Hello</button>
    <style jsx>{`
        #bg {
            top: -50%; 
            left: -50%; 
            width: 100%; 
            height: 200%;
        }
        #bg img {
            position: fixed; 
            top: 0; 
            left: 0; 
            right: 0; 
            bottom: 0; 
            min-width: 50%;
            min-height: 50%;
            z-index: -1;
            width: 100%;

        }
        #home-text-box {
            border: none;
            padding-to: 80px;
            position: fixed;
            top: 50%;
            left: 50%;
            margin-left: -250px;
            margin-top: -75px;
            background-color: rgba(107, 1, 102, 0.473);
        }
        h1 {
            color: white;
            font-weight: bold;
            display: inline-flex;
            font-size: 90px;
            margin: 5px;
            font-variant-caps: petite-caps;
        }
        h2 {
            display: inline-flex;
            font-size: 80px;
            margin: 5px;
            font-variant-caps: all-petite-caps;
            color: white;

        }
        h3 {
            font-size: 40px;
            margin-top: 0px;
            margin-bottom: 10px;
            font-variant-caps: all-petite-caps;
            color: white;
        }
    `}</style>
    <style global jsx>{`
        html,
        body {
            font-family: Comfortaa;
        }
    `}</style>
    </Layout>


)

export default Home;
